"original": |2-
     Additionally, specific versions of HTTP might have their own
     extensibility points, such as transfer codings in HTTP/1.1
     (Section 6.1 of [HTTP/1.1]) and HTTP/2 SETTINGS or frame types
     ([HTTP/2]).  These extension points are specific to the version of
     the protocol they occur within.
"fixed": |-
  Additionally, specific versions of HTTP might have their own extensibility points, such as transfer codings in HTTP/1.1 (Section 6.1 of [HTTP/1.1]) and HTTP/2 SETTINGS or frame types ([HTTP/2]).  These extension points are specific to the version of the protocol they occur within.
"ko": |-
  또한 특정 버전의 HTTP에는 HTTP/1.1([HTTP/1.1]의 섹션 6.1)의 전송 코딩 및 HTTP/2 설정 또는 프레임 유형([HTTP/2])과 같은 자체 확장 지점이 있을 수 있습니다. 이러한 확장 지점은 해당 확장 지점이 발생하는 프로토콜 버전에 따라 다릅니다.
